import React, { useEffect, useState } from "react";
import { Box, Typography, Grid, Paper, CircularProgress } from "@mui/material";
import { getAllOrders } from "../api/orders"; // fetch all orders

// Safe JSON parse
const safeParse = (val) => {
if (!val) return null;
try {
return JSON.parse(val);
} catch {
return val;
}
};

export default function OrdersPage() {
const [orders, setOrders] = useState([]);
const [loading, setLoading] = useState(true);

// src/pages/OrdersPage.js

useEffect(() => {
    // ✅ FIX: Retrieve the full user object from localStorage
    const currentUserJSON = localStorage.getItem("currentUser");
    if (!currentUserJSON) {
        setOrders([]);
        setLoading(false);
        return;
    }
    
    // Parse the object and get the username
    let username;
    try {
        const currentUser = JSON.parse(currentUserJSON);
        username = currentUser.username;
    } catch (e) {
        setOrders([]);
        setLoading(false);
        return;
    }

    // Now proceed with fetching and filtering
    // ... (rest of the logic)
    getAllOrders()
        .then((res) => {
            const userOrders = res.data.filter(
                (order) => order.userName.toLowerCase() === username.toLowerCase()
            );
            setOrders(userOrders);
        })
        .catch(console.error)
        .finally(() => setLoading(false));

}, []);
if (loading)
return <CircularProgress sx={{ mt: 5, display: "block", mx: "auto" }} />;

if (!orders.length)
return <Typography sx={{ p: 3 }}>You have not placed any orders yet.</Typography>;

return (
<Box sx={{ p: 3 }}>
<Typography variant="h4" sx={{ mb: 3 }}>
My Orders </Typography>


  <Grid container spacing={2}>
    {orders.map((order) => (
      <Grid item xs={12} key={order.id}>
        <Paper sx={{ p: 2 }}>
          <Typography variant="h6">Order ID: {order.id}</Typography>
          <Typography>User: {order.userName}</Typography>
          <Typography>Total: ₹{order.totalPrice}</Typography>
          <Typography>
            Delivery Date: {new Date(order.deliveryDate).toLocaleDateString()}
          </Typography>
          <Typography>Delivery Slot: {order.deliverySlot}</Typography>

          <Box sx={{ mt: 2 }}>
            <Typography variant="subtitle1">Items:</Typography>

            {order.items && order.items.length ? (
              order.items.map((item) => {
                const options = safeParse(item.selectedOptions) || {};
                const { single = {}, toppings = [] } = options;

                return (
                  <Paper key={item.id} sx={{ p: 1, mt: 1 }}>
                    <Typography>Name: {item.product?.name ?? item.name}</Typography>
                    <Typography>Quantity: {item.quantity}</Typography>
                    <Typography>Price: ₹{item.finalPrice}</Typography>

                    {Object.keys(single).length || toppings.length ? (
                      <Box>
                        <Typography>Options:</Typography>
                        {Object.entries(single).map(([key, val]) => (
                          <Typography key={key} sx={{ pl: 2 }}>
                            {key}: {val}
                          </Typography>
                        ))}
                        {toppings.length > 0 && (
                          <Typography sx={{ pl: 2 }}>
                            Toppings: {toppings.join(", ")}
                          </Typography>
                        )}
                      </Box>
                    ) : (
                      <Typography>Options: None</Typography>
                    )}
                  </Paper>
                );
              })
            ) : (
              <Typography>No items found</Typography>
            )}
          </Box>
        </Paper>
      </Grid>
    ))}
  </Grid>
</Box>

);
}
